import "./note.css"
import {useEffect, useState} from "react";
import {IsAuthenticated} from '../../isAuth/isAuth'

export const Note = ({text, date}) => {
    return (
        <div className="note">
            <div className="note_info">
                <span>{text}</span>
                <span>{date}</span>
            </div>
            <div className="note_functional">
                <button className="btn_delete">Удалить</button>
            </div>
        </div>
    )
}


export const GetNotes = () => {
    const [data, setData] = useState(null)

    useEffect(() => {
        fetch('http://localhost:8000/api/notes/', {'credentials': 'include', 'method': 'GET'})
            .then(res => res.json())
            .then(data => {
                setData(data)
            })
    }, []);
    if (!IsAuthenticated) return <h1>Сначала нужно зарегестрироваться</h1>
    if (data==null) return <h1>Loading...</h1>

    return (
        <>
            {data.map(note => <Note text={note.text} date={note.date}/>)}
        </>
    )

}
